import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import {determineDistanceBetweenDriverPatient} from '../Geolocation/locationServices';
import { useSelector } from 'react-redux'
import determineLatLongFromAddress from '../Geolocation/locationServices'

export default function CheckboxListSecondary() {

  const address = useSelector(
    (patientData => patientData.pickupAddress));

  const [driversList, setDriversList] = React.useState([
    {
      name: "Ahmed Rafsan Raqib",
      driverID: "raf97",
      location: "2302 130th Ave NW, Coon Rapids, MN, 55448, USA",
      vehicleId: 245,
      latitude: 45.206436,
      longitude:-93.324840
    }, 
    {
      name: "Ahmed Ispahan Raqib",
      driverID: "isp05",
      location: "1282 Concordia Ave, Saint Paul, MN, 55104, USA",
      vehicleId: 500,
      latitude: 44.9505630,
      longitude: -93.1552700
    }, 
    {
      name: "Labiba Nayeem Khan",
      driverID: "lab200",
      location: "300 Washington Ave SE, Minneapolis, MN,55455, USA",
      vehicleId:600,
      latitude: 44.9729,
      longitude: -93.2833
    }

  ])

  const calculateNearestDriver = async() => {
    const {lat, lng} = await determineLatLongFromAddress(address);
    var optimumDriverList = [];
    driversList.forEach(function (driver) {
      const lat1 = driver.latitude;
      const lng1 = driver.longitude;

      var distance = determineDistanceBetweenDriverPatient(lat, lng, lat1, lng1);
      console.log(driver.driverID);
      const driverData = {id: driver.driverID, distanceFromPatient: distance};
      optimumDriverList.push(driverData);
    });
    optimumDriverList.sort(function(a,b){
      console.log(a);
      console.log(b);
      //return a.distanceFromPatient - b.distanceFromPatient
    });

  }

  return (
  <div onLoad={calculateNearestDriver()}>
    <List dense sx={{ width: '100%', maxWidth: 360}}>
      {driversList.map((value) => {
        const labelId = `checkbox-list-secondary-label-${value}`;
        return (
          <ListItem key={value}>
            <ListItemButton>
              <ListItemAvatar>
                <Avatar
                  src={`/static/images/avatar/${value + 1}.jpg`}
                />
              </ListItemAvatar>
              <ListItemText id={labelId} primary={value.name} />
            </ListItemButton>
          </ListItem>
        );
      })}
    </List>
  </div>
  );
}
